import React from 'react';
import '../hubungi_kami/hubungikami.css'; 


function hubungikami() {
    return (
      <>
        <div id="parallax-world-of-ugg">
            <section>
                <div className="parallax-one">
                    <h2>SOUTHERN CALIFORNIA</h2>
                </div>
            </section>
        </div>

      </>
   
    )
}

export default hubungikami;
